import React from 'react';
import GeneralInformation from '../../containers/generalInformation';

import Title from '../title';
import Skills from '../skills'
import Education from '../education'

import './style.css';

const Main = () => {

  return (
    <div className="main">
      <GeneralInformation/>
      <Title name="skills"/>
      <Skills/>
      <Title name="education"/>
      <Education/>
    </div>
  )
};

export default Main;
